import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';
import Visualizer from './Visualiser'; // Import the Visualizer component

function App() {
  return (
    <Router>
      <div className="App">
        <div className="welcome-screen">
          <h1>Welcome</h1>
          {/* Use React Router's Link to route */}
          <Link to="/Visualizer">
            <button>Go to Visualizer</button>
          </Link>
        </div>
      </div>

      {/* Define routes */}
      <Routes>
        {/* Route to Visualizer page */}
        <Route path="/Visualizer" element={<Visualizer />} />
      </Routes>
    </Router>
  );
}

export default App;
